function App() {
  return (
    <div className="App">
      <BrowserRouter>
                <Routes>
                    <Route path='/' element={<WelcomePage/>}></Route>
                    <Route path='/Registration' element={<Registration/>}></Route>
                    <Route path='/Login' element={<Login/>}></Route>
                </Routes>
            </BrowserRouter>
    </div>
  );
}

export default App;
